import React from 'react'

const Popup = () => {
  return (
    <div className='absolute hidden
    bg-green-200 top-0 left-0 rounded-xl p-2 leading-5' id="popup">
    <p id='lat'>Lat: </p>
    <p id='lon'>Lon: </p>
    </div>
  )
}

export default Popup
